import { Table as TableStrap } from 'reactstrap'
import styled from 'styled-components'

const S = {
  Table: styled(TableStrap)`
    margin: 0 auto;
  `,

  Header: styled.thead``,

  HeaderCol: styled.th`
    border-top: 0!important;
  `,

  Body: styled.tbody``,
  Row: styled.tr``,
  Col: styled.td``,
  ProductName: styled.span`
  `
}

const headers = [
  {
    id: 1,
    title: 'Email'
  }, {
    id: 2,
    title: 'Hero Intro'
  }, {
    id: 3,
    title: 'Hero Magic'
  },
  {
    id: 4,
    title: 'Hero Profecy'
  },
]

const UserInfo = ({ data }) => {
  return (
    <S.Table>
      <S.Header>
        <S.Row>
          <S.HeaderCol></S.HeaderCol>
          { 
            headers.map(({id, title}) => (
              <S.HeaderCol key={id}>{title}</S.HeaderCol>
            ))
          }
        </S.Row>
      </S.Header>
      <S.Body>
        {data.map(user => (
          <S.Row key={user.userId}>
            <S.Col>
              <S.ProductName>
                {user.email}
              </S.ProductName>
            </S.Col>
            <S.Col>
              {user.hero_intro}
            </S.Col>
            <S.Col>
              {user.hero_magic}
            </S.Col>
            <S.Col>
              {user.hero_profecy}
            </S.Col>
          </S.Row>
        ))}
      </S.Body>

    </S.Table>
  )
}

export default UserInfo
